  return (
    <Stage width={window.innerWidth} height={window.innerHeight}>
      <Layer>
        <Rect
          x={50}
          y={50}
          width={100}
          height={100}
          fill="white"
          shadowBlur={0}
        />
      </Layer>
    </Stage>
  );
}

export default Cell;
